import React from 'react';





function App() {
    const mystle={
        flexdirection: "column",
        justifyContent: "flex-start",
        width:"45%",
        backgroundColor:"white",
        textAlign:"center",
        margin:"128px auto",
        borderRadius:"8px",
        paddingBottom:"40%",
        boxShadow: "2px 2px 2px",

    };
    const headstyle={
        backgroundColor:"lightblue",
        color:"white",
    }
    return ( 
        <div  style={mystle}>
            <div style={headstyle}>
                <h1>Todo List</h1>
            </div>

        </div>






    );
}

export default App;
